import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () =>
{
  return (

      <div className="Menu">
        <h3>TEST PROJECT</h3>
        <Header />
        <Techonologies />
      </div>
  )
}
const Header = () =>
{
  return(
      <div>
        <a>Игорь </a>
        <a>Алексей </a>
        <a>Анатолий </a>
      </div>
  )
}
const Techonologies = () =>
{
  return (
      <div>
        <h4>Привет, сейчас ты можешь ознакомиться с полным списком ЯП</h4>
        <ul>
          <li>C#</li>
          <li>C</li>
          <li>C++</li>
        </ul>
      </div>
  )
};

export default App;
